import { Link } from 'react-router-dom';

export default function HomeScreen() {
  return (
    <div className='container'>
      <Link to='/signin?redirect=enquiry'><h2 style={{textAlign:'center'}}>Enquiry</h2></Link>
      
      <Link to='/signin?redirect=order'><h2 style={{textAlign:'center'}}>Order</h2></Link>
    
    </div>
  );
}
